webpackJsonp([38258397313894],{6578:function(e,t){e.exports={data:{post:{html:'<p>Today we had all the relatives over for Christopher\'s birthday (a day late, but he can\'t read a calendar yet). As a highlight we served <a title="code: theWebSocket; - Cheesecake" href="http://www.ahawkins.org/mt/archives/000157.html">Alwin\'s cheesecake</a>, which went over very well with the guests, even my mother-in-law the super-baker (although next time I will use <em>Schmand</em> instead of <em>Saure Sahne</em> for sour cream). And Christopher scored more presents. But now he should be gifted out for the next year.</p>',fields:{title:"Partytime",date:"28 Dec 2003",url:"https://papascott.de/2003-12-28-partytime/"}}},pathContext:{slug:"/2003-12-28-partytime/",prev:{fields:{title:"Earthquake in Iran",date:"27 Dec 2003",slug:"/2003-12-27-earthquake-in-iran/"}},next:{fields:{title:"Terror Alarm in Hamburg",date:"30 Dec 2003",slug:"/2003-12-30-terror-alarm-in-hamburg/"}}}}}});
